import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Search, Bell, User, Calendar, Plus, ChevronDown } from 'lucide-react';
import '../styles/HomePage.css'
import { ReactComponent as Logo } from './Assets/logo.svg';
import menuconfig from './config/MenuConfig.json'

const HomePage = () => {
  const [destination, setDestination] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [isPlanning, setIsPlanning] = useState(false);

  const handleStartPlanning = (e) => {
    e.preventDefault();
    setIsPlanning(true);
  };

  const handleResetPlanning = () => {
    setDestination('');
    setStartDate('');
    setEndDate('');
    setIsPlanning(false);
  };

  return (
    <div className="Tinoto-home">
      <nav className="nav">
        <div className="nav-left">
                  <div className="logo">
          <Logo className="logo-icon" />
          <span className="logo-text">Tinoto</span>
        </div>

          <div className="nav-links">
            <a href="#" className="nav-link active">Home</a>
            <a href="#" className="nav-link">Travel guides</a>
            <a href="#" className="nav-link">Hotels</a>
            <a href="#" className="nav-link">Deals</a>
          </div>
        </div>
        <div className="nav-right">
          <div className="search-container">
            <input type="text" placeholder="Enter place or user" className="search-input" />
            <Search className="search-icon" />
          </div>
          <Bell className="nav-icon" />
          <User className="nav-icon" />
        </div>
      </nav>

      <main className="main-content">
        <h1 className="main-title">Plan a new trip</h1>

        <div className="trip-form">
          <input type="text" placeholder="Where to? e.g. Paris, Hawaii, Japan" className="destination-input" />

          <div className="dates-container">
            <p className="dates-label">Dates (optional)</p>
            <div className="dates-inputs">
              <div className="date-input">
                <Calendar className="date-icon" />
                <span>Start date</span>
              </div>
              <div className="date-input">
                <Calendar className="date-icon" />
                <span>End date</span>
              </div>
            </div>
          </div>

          <div className="trip-options">
            <button className="invite-button">
              <Plus className="invite-icon" />
              Invite tripmates
            </button>
            <button className="friends-button">
              Friends
              <ChevronDown className="friends-icon" />
            </button>
          </div>

          <div className="start-planning-container">
            <button className="start-planning-button">
              Start planning
            </button>
          </div>
        </div>

        <p className="write-guide-text">Or write a new guide</p>
      </main>
    </div>
  );
};

export default HomePage;
